        <div className='admindiv'>

            <Box className='admindiv'>
                <Typography variant='h1'>For Admin</Typography>

                <ThemeProvider theme={theme}>
                    <Container component="main" maxWidth="xs">
                        <CssBaseline />
                        <Box
                            sx={{
                                marginTop: 8,
                                display: 'flex',
                                flexDirection: 'column',
                                alignItems: 'center',
                            }}
                        >

                            <Typography component="h1" variant="h5">
                                ADD ROOMS
                            </Typography>
                            <Box >
                                <Box>
                                    <SMInput
                                        className='inp'
                                        margin="normal"
                                        onChange={(e) => { setSaveData({ ...saveData, class: e.target.value }) }}
                                        required
                                        fullWidth={true}
                                        label="Number of bedrooms"
                                        type="text"
                                    />

                                </Box>
                                <Box>
                                    <SMInput
                                     className='inp'
                                        margin="normal"
                                        onChange={(e) => { setSaveData({ ...saveData, section: e.target.value }) }}
                                        required
                                        fullWidth={true}
                                        label="Price"
                                        type="text"
                                        autoFocus
                                    />

                                </Box>
                                <Box>

                                    <SMInput
                                     className='inp'
                                        margin="normal"
                                        onChange={(e) => { setSaveData({ ...saveData, dateofstart: e.target.value }) }}
                                        required
                                        label='Enter image url'
                                        fullWidth={true}
                                        type="text"
                                        autoComplete="current-password"
                                    />
                                </Box>
                                <SMInput
                                 className='inp'
                                    margin="normal"
                                    required
                                    fullWidth={true}
                                    label="Services"
                                    onChange={(e) => { setSaveData({ ...saveData, qualification: e.target.value }) }}
                                    type="text"
                                    autoComplete="current-password"
                                />
                                <SMButton
                                    type="submit"
                                    label="Submit"
                                    fullWidth
                                    variant="contained"
                                    onClick={sendfunc}
                                    sx={{ mt: 3, mb: 2 }}

                                    Submit
                                />

                            </Box>
                        </Box>
                    </Container>
                </ThemeProvider>
            </Box>
        </div>
    )
}
export default Form;
